import React from 'react';
import { BrowserRouter as Router, Routes, Route, useNavigate } from 'react-router-dom';
import './styles/App.css';

const App: React.FC = () => {
    return (
      <Router>
        <div className="App">
          <header className="App-header">
            <h1>SwampHacks 2025</h1> {/* Change this header text */}
          </header>
          <main>
            <Routes>
                <Route path="/" element={<LocalWelcomePage />} />
                <Route path="/example" element={<LocalExamplePage />} />
                <Route path="/about" element={<LocalAboutPage />} />
            </Routes>
          </main>
        </div>
      </Router>
    );
  };

export default App;

// Welcome Page
const LocalWelcomePage: React.FC = () => {
  const navigate = useNavigate();

  const handlePrevious = () => navigate('/about');
  const handleNext = () => navigate('/example');

  console.log('Rendering Welcome Page'); // Debug log

  return (
    <div>
      <h2>Welcome Page</h2>
      <p>This is the welcome page of your app.</p>
      <div className="navigation">
        <button className="button" onClick={handlePrevious}>&larr; Previous</button>
        <button className="button" onClick={handleNext}>Next &rarr;</button>
      </div>
    </div>
  );
};

// Example Page
const LocalExamplePage: React.FC = () => {
  const navigate = useNavigate();

  const handlePrevious = () => navigate('/');
  const handleNext = () => navigate('/about');

  console.log('Rendering Example Page'); // Debug log

  return (
    <div>
      <h2>Example Page</h2>
      <p>This is an example page.</p>
      <div className="navigation">
        <button className="button" onClick={handlePrevious}>Previous</button>
        <button className="button" onClick={handleNext}>Next</button>
      </div>
    </div>
  );
};

// About Page
const LocalAboutPage: React.FC = () => {
  const navigate = useNavigate();

  const handlePrevious = () => navigate('/example');
  const handleNext = () => navigate('/');

  console.log('Rendering About Page'); // Debug log

  return (
    <div>
      <h2>About Page</h2>
      <p>This is the about page of your app.</p>
      <div className="navigation">
        <button className="button" onClick={handlePrevious}>Previous</button>
        <button className="button" onClick={handleNext}>Next</button>
      </div>
    </div>
  );
};
